releaseNotes:
Changes of version 1.20.4
 - Long-awaited final of the Chapter VII: incredible bosses, scenic locations and the story pinnacle;
 - New Transfomation story mode: unexpected storyline and even harder fights that will be a challenge for the most experienced fighters;
 - New equipment including a brand new fight style, both agile and attractive;
 - Critical bugs fixed, also general performance of the game improved.

Warriors! Meet Update 4.6.4.4! What’s new:  
- A new Tournament group for level 116-120 players; 
- A new difficulty setting of Clan brawls for level 116-120 players; 
- A new hero, Hamming the Beastborn Bard, will soon join the ranks of Haradan’s heroes.

﻿- The Contact event is back! The long-awaited opportunity to get implants for your planes!
- Prices lowered! Rerolling your plane when assembling an implant now costs 75 crystals;
- Other improvements and bug fixes!

﻿Pilots, buckle up! We are glad to present you the Update 12.0!

What's new:
- New stages and a new boss!
- New ship — Bully!
- New Core levels;
- New platforms to better protect your carrier;
- New level of the Tech Lab and new abilities;
- Changes for acquiring platforms with a full storage. Now it is obligatory to reprocess one of the old platforms before getting a new one.
- Other improvements and bug fixes!

— New neighbor castles and special chests with locks. Neighbor's castles now update regularly. Search for your neighbors (and the keys to their chests) at skull locations!
— New Event "Merchant Escort" with different possible outcomes for players level 15+;
— Unique Plague Doctor Mask will help Exiles survive the Plague pandemic;
— Order messages now show the time when they were sent;
— Increased Energy Regeneration bonus extended!

description:
Passion Puzzle - a fascinating free to play dating sim game where you can take a dive into summer love adventure. 

The story starts when you arrive in a coastal city as a tourist to relax and make some new friends. On your way you meet many lovely girls who seem to be really interested in you. 
Who will you choose at the end? Sweet and kind Mary, strict Ivy, tameless Ioly, kinky Mika, sophisticated Shantal or kinda naive but still gorgeous Emilia? Try to win the heart of one or all of them - level up your sexuality, sense of humor or intellect by completing easy match 3 tasks. 

Date & flirt, get hot selfies and follow the intriguing storyline of Passion Puzzle!

You will like this game if you:
- like dating sim games & dating games for boys;
- are interested in dating pretty girls and building relationships;
- are fond of solving match 3 puzzles;
- like anime, anime games & Japanese culture;
- believe that there are interesting matching games for adults and want to play one of them.

Reach out to each of the girls - choose the right answer in the dialogue and get extra bonuses playing 3 in a row games. Get lost in exciting love games with elements of dating simulator!

